import React, { Component } from 'react';
import {Header, Segment } from 'semantic-ui-react';


export default class SiteHeader extends Component {

    render() {
        return (

            <Segment>
                <Header as='h3' textAlign='left'>
                    Charlie Leopard
                </Header>
                <Header as='h4' textAlign='right'>
                    Home
                </Header>
            </Segment>

        );
    }
}
